import {GET_BOOKMARKS, GET_BOOKMARK} from "../actions/types";

const initialState = {
    bookmarks: [],
    bookmark: {}
};

export default function (state = initialState, action) {
    switch (action.type) {
        case GET_BOOKMARKS:
            return{
                ...state,
                bookmarks: action.payload
            };
        case GET_BOOKMARK:
            return {
                ...state,
                bookmark: action.payload
            };
        default:
            return state;
    }
}
